text:
Honored to host @ActSecJulieSu and @MRCCUnion to announce this fantastic news from the Biden administration.

These hard-working Americans paid into a system promising a comfortable retirement.

@POTUS and @VP kept that promise. https://t.co/Mq7F9ImEZE

Today, @EPA strengthened drinking water regulations requiring all lead pipes to be replaced in 10 years.

@DetroitWaterDep has received $90 million from @POTUS and @VP, putting the city on track to meet this goal.

No one should ever worry about the water coming from their sink. https://t.co/Lm2BOr7TAe
